import "./App.css";
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
function App(){
  return(
    <Router>
      <div className = "App">Hello World</div>
      <Switch>
        <Route exact path = "/" element = {<Home/>}/>
        <Route exact path = "./Pages/Login.js" element = {<Login/>}/>
        <Route exact path = "./Pages/Sign_Up.js" element = {<Sign_Up/>}/>
      </Switch>
    </Router>
  )
}

export default App;
